import Product from "../components/products/Product";
import { Col } from "react-bootstrap";



const ProductDetails = () => {
    return ( 
        <>
        <Col xs={12} className="product-column">
        <Product 
        id="1"
        image="https://static.nike.com/a/images/t_PDP_1728_v1/f_auto,b_rgb:f5f5f5/d72512e5-7c88-4473-9263-1cabb53a6411/meskie-buty-do-biegania-po-asfalcie-air-zoom-pegasus-39-rZmWzq.png"
        title="Product 2"
        text="Some TExt4"
        price="2"/>
        </Col>
        </>
     );
}

export default ProductDetails;
